INSERT INTO `faq_content_table` VALUES (1,3,'¿Puede soportar la simpledb toda la funcionalidad que se necesita para la aplicación notificaciones - push?\r\nTener en cuenta tanto las bases de datos relaciones (preferiblemente las de Amazon) como base de datos documentales (MongoDB). Comprobar que además, MongoDB nos permite escalar, y si es posible, monstar clúster. Contrastar con sistemas dicha información.','',2,'2012-09-13 15:50:42','2012-09-13 15:50:42','f',3,NULL,NULL),(2,3,'Realizar un estudio de todos los campos que soportan las plataformas de push. Es decir, una tabla excel con los campos y el nombre en las distintas plataformas. Ver si es posible incorporar nuevos campos que sean ignorados por las plataformas. Por ejemplo, si se puede meter un campo <id> dentro del mensaje y que llegue a la aplicación cliente, aunque no sea procesada por apple, google..','',2,'2012-09-13 15:52:29','2012-09-13 15:52:29','f',3,NULL,NULL),(3,3,'Conocer la estructura de MAT para comprobar que hay que tener en cuenta en esta fase para realizar una siguiente fase con estadísticas.','',2,'2012-09-13 15:58:14','2012-09-13 15:58:14','f',3,NULL,NULL);
