INSERT INTO `proj10_feedback_content_table` VALUES (1,1,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 10:48:15','<p>Set Priority:Normal</p><p>Description:</p><p>Se debe formatear el email con alguna imagen. Adem&aacute;s, hay que cambiar lo de bolsa por bote y quitar el bagid.</p>','',''),(2,2,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 10:50:09','<p>Set Priority:Alta</p><p>Description:</p><p>Si al crear la bolsa el json que se env&iacute;a no est&aacute; bien formado se muestra una excepci&oacute;n al usuario (no se deber&iacute;a enviar nunca c&oacute;digo en el servicio).</p>','',''),(3,3,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 10:50:49','<p>Set Priority:Muy Alta</p><p>Description:</p><p>Al consultar una bolsa se muestra en el bag_id el nombre de la bolsa.</p>','',''),(4,4,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 10:52:13','<p>Set Priority:Baja</p><p>Description:</p><p>No me deber&iacute;a dejar confirmar una bolsa sobre un usuario que no est&eacute; confirmado.</p>','',''),(5,5,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 10:53:15','<p>Set Priority:Muy Alta</p><p>Description:</p><p>No se deber&iacute;a devolver spp_respose como nodo central de la respuesta una vez que se ha elminado una participaci&oacute;n en una bolsa.</p>','',''),(6,6,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 12:02:55','<p>Set Priority:Normal</p><p>Description:</p><p>Al vaciar una bolsa se crea un movimiento con texto&nbsp;04-04-Unlocking funds from bag. Se deber&iacute;a cambiar dicho texto.</p>','',''),(7,7,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 12:12:58','<p>Set Priority:Baja</p><p>Description:</p><p>Habr&iacute;a que ver si hay que cambiar el estado de estos movimientos o ponerlos de alguna forma diferente para que no se mostrasen por las aplicaciones clientes.</p>','movimientos_vaciar_bolsa.png',''),(8,8,'marcoantonio.sanz@bbva.com',NULL,'2013-03-08 15:03:42','<p>Set Priority:Normal</p><p>Description:</p><p>Al consultar los movimientos de un usuario por fechas de 01/01/2013 y 01/04/2013 la aplicaci&oacute;n da un fallo.</p>','','');
/*!40000 ALTER TABLE `proj10_feedback_content_table` ENABLE KEYS */;
UNLOCK TABLES;

