INSERT INTO `proj3_feedback_content_table` VALUES (7,3,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:41:25','<p>Set Priority:Muy Alta</p><p>Description:</p><p><div style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">Ser&iacute;a cambiar subject y text por title y content.&nbsp;</div><div><br /></div></p>','',''),(8,4,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:45:09','<p>Set Priority:Normal</p><p>Description:</p><p><p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">Eliminar las etiquetas que hac&iacute;an referencia dentro del tipo title.</span></p><p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; line-height: normal; font-weight: normal\"><span style=\"font-size: 12px; font-family: \'Courier New\'; background-color: transparent; vertical-align: baseline; white-space: pre-wrap\">msgbacktitle</span></strong>&nbsp;: etiqueta title del mensaje</p><p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; line-height: normal; font-weight: normal\"><span style=\"font-size: 12px; font-family: \'Courier New\'; background-color: transparent; vertical-align: baseline; white-space: pre-wrap\">msgBackContent</span></strong>&nbsp;: etiqueta content del mensaje</p></p>','',''),(9,5,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:46:30','<p>Set Priority:Normal</p><p>Description:</p><p>Al modificar el nombre de la aplicaci&oacute;n dentro del Manager se produce un error y no te deja modificarla.</p>','',''),(10,6,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:47:31','<p>Set Priority:Muy Baja</p><p>Description:</p><p>Mostrar la tabla vac&iacute;a o bloquear las operaciones cuando no existen elementos en las tablas del manager.</p>','',''),(11,7,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:49:48','<p>Set Priority:Alta</p><p>Description:</p><p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">Cuando estamos filtrando no aparecen todos los dispositivos de los usuarios</span></p>','',''),(12,8,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:50:10','<p>Set Priority:Baja</p><p>Description:</p><p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">Aunque el usuario no est&eacute; asociado a un tag y lo intentamos desasociar le damos un ok como si estuviera asociado</span></p>','',''),(13,9,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:51:13','<p>Set Priority:Alta</p><p>Description:</p><p><div style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">en los mensajes a wp por defecto (title + toast) en title deber&iacute;amos hacer:</div><div style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">si msgtitle es vac&iacute;o</div><div style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">poner title=texto del mensaje</div><div style=\"color: #222222; font-family: arial, sans-serif; line-height: normal\">si texto mensaje es mayor que longitud title poner el texto y puntos suspensivos.</div></p>','',''),(14,9,NULL,2,'2012-09-11 10:52:06','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(15,8,NULL,2,'2012-09-11 10:52:32','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(16,7,NULL,2,'2012-09-11 10:52:51','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(17,5,NULL,2,'2012-09-11 10:53:14','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(18,4,NULL,2,'2012-09-11 10:54:23','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(19,3,NULL,2,'2012-09-11 10:54:41','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(20,10,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 10:57:51','<p>Set Priority:Normal</p><p>Description:</p><p>Crear los campos de creation_date y updated_date dentro de la tabla de usuarios y tags para poder realizar posteriormente tareas de mantenimiento.</p>','',''),(21,10,NULL,2,'2012-09-11 10:58:15','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(22,11,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 12:48:59','<p>Set Priority:Alta</p><p>Description:</p><p><p>Realizar un acuse de recibo que nos permita garantizar que una determinada notificaci&oacute;n ha llegado a sus destinatarios. Para ello, se deber&aacute; realizar las siguientes tareas:</p><p>1) Devovler un ID de notificaci&oacute;n cada vez que se cree una.</p><p>&nbsp;2) Crear un nuevo servicio que devuelva los env&iacute;os realizados para una determinada notificaci&oacute;n. </p><p>GET notifier/notifications/{notification_id}/</p><p>Devolver&aacute; los datos de la notificaci&oacute;n que se realiz&oacute; en su d&iacute;a, la fecha en que se realiz&oacute; y el estado en que se encuentra (received, partial received, error, queued)&nbsp;</p><p>GET notifier/notifications/{notification_id}/sendings/</p><p>Los env&iacute;os deber&aacute;n tener la siguiente informaci&oacute;n:</p><p>creation_date:fecha de creaci&oacute;n del env&iacute;o</p><p>sending_id : identificador del env&iacute;o</p><p>platform: plataforma</p><p>device_id: id del dispositivo</p><p>token: token actual del dispositivo</p><p>status: estado del env&iacute;o</p><p>Se deber&aacute; implementar los siguientes par&aacute;metros: pag (paginaci&oacute;n) &nbsp;</p><p>3) Enviar dentro del campo oculto de la notificaci&oacute;n (realmente del env&iacute;o) el id del env&iacute;o para que el cliente podr&aacute; invocar al servicio de actualizaci&oacute;n de env&iacute;o.</p><p>4) El dispositivo deber&aacute; invocar al servicio de actualizaci&oacute;n de env&iacute;os</p><p>POST notifier/sendings/{SENDING_ID}</p><p>&lt;status&gt;received&lt;/status&gt;</p><p>&nbsp;</p></p>','',''),(23,12,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 12:50:04','<p>Set Priority:Normal</p><p>Description:</p><p>Aunque el reporting no se realice en la versi&oacute;n 1.1 se deber&aacute; preparar la aplicaci&oacute;n para poder extraer la informaci&oacute;n para las estad&iacute;sticas.</p>','',''),(24,13,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 12:51:41','<p>Set Priority:Alta</p><p>Description:</p><p><p>Se podr&aacute; borrar un dispositivo en concreto</p><p>Se crear&aacute; un nuevo servicio</p><p>DELETE notifier/users/{user_id}/devices/{device_id}</p><p>&nbsp;</p></p>','',''),(25,14,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 13:00:23','<p>Set Priority:Alta</p><p>Description:</p><p><p>Se deber&aacute; incorporar un identificador del dispositivo y un alias del mismo. As&iacute;, cuando un usuario de de alta un dispositivo se podr&aacute;n informar dos nuevos campos (alias y device_id). As&iacute; en</p><p>POST notifier/users </p><p>se podr&aacute; enviar el siguiente contenido:&nbsp;</p><p>&lt;users&gt; &nbsp;</p><p>&lt; user&gt;</p><p>&lt;user_id&gt;&lt;/user_id&gt;</p><p>&lt;banned&gt;true/false&nbsp;</p><p>&lt;platforms&gt;&nbsp;</p><p>&lt;android&gt;</p><p>&nbsp; &nbsp;&lt; appVersion&gt; Versi&oacute;n de la aplicaci&oacute;n</p><p>&nbsp; &nbsp;&lt;token&gt; Token del proveedor de push (apple, google..)</p><p>&nbsp; &nbsp; &lt;alias&gt; Alias del dispositivo para el usuario. Se puede repetir</p><p>&nbsp; &nbsp; &lt;device_id&gt; Id del dispositivo. Si no viene informado token=device_id</p><p>&nbsp; &nbsp; &lt;inactive&gt; true/false. Indica que el dispositivo est&aacute; inactivo (no tiene mucho sentido si se crea)</p><p>&nbsp; &nbsp; &nbsp;&lt;enabled&gt;&nbsp;true / false. Indica que el dispositivo est&aacute; habilitado para recibir mensajes.</p><p>&nbsp;Todas las operaciones pasar&aacute;n a realizarse con devide_id.&nbsp;</p></p>','',''),(26,15,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 14:26:44','<p>Set Priority:Alta</p><p>Description:</p><p><p>A&ntilde;adir el campo de creation_date y modified_date a las tablas de tags y usuarios (y devices si tambi&eacute;n se realizan al final).</p><p>Adem&aacute;s, a&ntilde;adir el campo de &lt;last_access&gt; a la informaci&oacute;n que se devuelve del dispositivo</p><p>&lt;android&gt;</p><p>&lt;token&gt;</p><p>&lt;last_acsess&gt;</p><p>...&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(27,16,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 15:41:23','<p>Set Priority:Alta</p><p>Description:</p><p><p>Se deber&aacute; poder enviar notificaciones a un dispositivo en concreto. Por lo tanto, el mensaje de notificaci&oacute;n tendr&aacute; un nuevo tag donde se pueda indicar los dispositivos:</p><p>&lt;platforms&gt; &lt;/platforms&gt;</p><p>&lt;target&gt;</p><p>&nbsp; &nbsp; &lt;users&gt;</p><p>&nbsp; &nbsp; &nbsp;&lt;tags&gt;</p><p>&nbsp; &nbsp; &nbsp; &lt;devices&gt;{device_id},{device_id}...</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(28,17,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 15:44:50','<p>Set Priority:Alta</p><p>Description:</p><p><p>De debe poder habilitar o deshabilitar un dispositivo en concreto. Se implementar&aacute; un nuevo servicio que permite modificar dispositivos.</p><p>PUT http://..../notifier/users/{user_id}/devices/{device_id}</p><p>los datos ser&aacute;n los mismos que en el nodo plataforma.</p><p>&lt;android&gt;</p><p>&nbsp; &nbsp;&lt;token&gt;...</p><p>&nbsp; &nbsp; &lt;enabled&gt;true/false</p><p>&nbsp; &nbsp; &lt;alias&gt;</p><p>&nbsp; &nbsp; &lt;device_id&gt;</p><p>&nbsp; &nbsp; &nbsp;&lt;inactive&gt;true/false</p><p>&nbsp; &nbsp; &nbsp;&lt;appversion&gt;&nbsp;</p><p>..&nbsp;</p><p>&nbsp;</p></p>','',''),(29,18,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 15:45:58','<p>Set Priority:Alta</p><p>Description:</p><p>Se deber&aacute; estructurar el campo oculto. Queda pendiente de una pregunta a GLOBALNET para saber los campos disponibles en cada plataforma.</p>','',''),(30,19,'marcoantonio.sanz@bbva.com',NULL,'2012-09-13 15:47:29','<p>Set Priority:Muy Alta</p><p>Description:</p><p><p>Realizar un estudio para saber si es necesario cambiar la base de datos de Notificaciones - Push o no.</p><p>Se debe contemplar tanto bases de datos relaciones (sobre todo las que soporta Amazon) como base de datos orientadas a documentos (como Mongo DB) siempre que las mismas puedan ser clasterizables.</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(31,13,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 15:52:44','<p>Set Priority:Normal,Status: Open</p><p>Description:</p><p></p>','',''),(32,11,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 15:52:58','<p>Set Priority:Normal,Status: Open</p><p>Description:</p><p></p>','',''),(33,10,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 15:53:13','<p>Set Priority:Alta,Status: In process</p><p>Description:</p><p></p>','',''),(34,19,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 15:53:42','<p>Set Priority:Alta,Status: Open</p><p>Description:</p><p></p>','',''),(35,7,'marcoantonio.sanz@bbva.com',NULL,'2012-09-18 11:11:33','<p>Set Priority:Alta,Status: Closed</p><p>Description:</p><p><p>He comprobado que realmente no se reproduce.</p><p>http://push.gobernalianet.es/users?platforms=android</p><p>&lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;</p><p>&lt;notification_response&gt;</p><p>&nbsp; &nbsp; &lt;result&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &lt;code&gt;200&lt;/code&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &lt;info&gt;OK&lt;/info&gt;</p><p>&nbsp; &nbsp; &lt;/result&gt;</p><p>&nbsp; &nbsp; &lt;data&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &lt;users&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;user&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;userId&gt;00000000t&lt;/userId&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;banned&gt;false&lt;/banned&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;platforms&gt;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;a