-10-18 09:52:03','<p>Set Priority:Alta</p><p>Description:</p><p><p>Si ponemos</p><p>DELETE /notifier/users?platforms=android&amp;tags=vips</p><p>si encuentra usuario en el tag vip, filtra correctamente, sino me devuelve todos los usuarios de la plataforma android.</p><p>&nbsp;Funciona igual con el listado de usuarios. </p></p>','',''),(61,23,NULL,2,'2012-10-18 09:52:34','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(62,24,'marcoantonio.sanz@bbva.com',NULL,'2012-10-18 10:23:53','<p>Set Priority:Alta</p><p>Description:</p><p><p>Tanto para Json como para xml se deber&aacute; realizar no case sensitive tanto los par&aacute;metros del body como los de la url. Por ejemplo: </p><p>{<br />&nbsp; &quot;user&quot;: {<br />&nbsp;&nbsp;&nbsp; &quot;platforms&quot;: {<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;android&quot;: {<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;appVersion&quot;: &quot;1.0&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;token&quot;: &quot;APA91bE_8UgjpeK7gFOUTcw_UgMIrjGSdBo5fy1eNQizM0-2u0SZ7_qwTLiTaaqbfE555_6ce2qxklw7tzyzjYvqNC_3LBA-x4tpNORDOUKd8jcKUWX5ElgrTvRg6Dhpbsoh6T1Zz3bV&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;deviceAlias&quot;: &quot;Tel&eacute;fono del trabajo&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;disabled&quot;: &quot;true&quot;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }<br />&nbsp;&nbsp;&nbsp; }<br />&nbsp; }<br />}</p><p>&quot;user&quot; podr&iacute;a venir como &quot;USER&quot;,&quot;user&quot;... y as&iacute; con disabled, deviceAlias...</p><p>en las urls tambi&eacute;n:</p><p>http://push.gobernalianet.es/users?tags=vip&amp;platforms=android&amp;appVersion=1.0</p><p>tags podr&iacute;a venir como TAGS, tAgs.. y el resto de par&aacute;metros igual.&nbsp;</p><p>&nbsp;Sin embargo, http://push.gobernalianet.es/users/androidUser</p><p>la url en s&iacute; misma no tiene que ser no case sensitive, es decir, para actulizar el usuario androidUser deber&iacute;an poner la url &quot;http://push.gobernalianet.es/users/androidUser&quot;</p><p>Hay que tener en cuenta que hay que ser compatible con lo existente. </p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(63,24,NULL,2,'2012-10-18 10:24:19','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(64,25,'marcoantonio.sanz@bbva.com',NULL,'2012-10-18 14:41:44','<p>Set Priority:Alta</p><p>Description:</p><p>odos los par&aacute;metros de entradas (los que van en el body como en la petici&oacute;n ser&aacute;n no case sensitive).<br /><br />En  los par&aacute;metros de salida se cambiar&aacute; en todos los servicios que  devuelven los dispositivos: devicealias y deviceid por deviceAlias y  deviceId<br /> <br />Se cambiar&aacute; enabled por disabled en los siguientes servicios tanto  en el body (en crear usuario, actualizar usuario..) como en los  par&aacute;metros de respuesta (cuando se listan dispositivos)-<br /><br />Dentro de los par&aacute;metro del listado de usuarios se cambia appVersion por appVersions<br /> <br />Dentro del borrado de usuarios &quot;device&quot; por deviceIds y tags por tagIds, versions por appVersions<br /><br />Dentro de las notificaciones: cambiar tags por tagIds, users por userIds y devices por deviceIds, type por typeId.<br /> <br />Dentro&nbsp; de asociar usuarios a un tag: cambiar users por userIds tanto en el body como en la respuesta<br /><br />Dentro&nbsp;  de Asociar / desasociar usuarios a tags se cambia tags por tagIds  (tambi&eacute;n en la respuesta cuando no se puede asociar (dentro del failed)<br /> <br />Dentro del listado de tags de un usuario : tags por tagIds tanto en el body como en la respuesta<br /><br />Cambiar name dentro del type por typeName.<br /><br /><br />He realizado una colecci&oacute;n y he actualizado el API.<br /><br /> <a href=\"https://docs.google.com/a/bbvaglobalnet.com/file/d/0ByYvNo6IacyDamFfT3ZfdFhOLUU/edit\" target=\"_blank\">https://docs.google.com/a/bbvaglobalnet.com/file/d/0ByYvNo6IacyDamFfT3ZfdFhOLUU/edit</a><br /><br />Un saludo.</p>','',''),(65,25,NULL,2,'2012-10-18 15:05:51','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(66,26,'marcoantonio.sanz@bbva.com',NULL,'2012-12-19 17:26:46','<p>Set Priority:Alta</p><p>Description:</p><p><p>Se deber&aacute; poner a nivel de usuario la propiedad banned. Por lo tanto, deja de ser un tag especial (vamos un tag) y se utilizar&aacute; como estado.</p><p>Adem&aacute;s, hay que ponerlo como par&aacute;metro de entrada en buscar usuarios y eliminar usuarios para que se puedan buscar y eliminar (ver API). Tambi&eacute;n hay que meter el par&aacute;metro deviceDisabled= y deviceInactive=true/false. adem&aacute;s de userBanned=true/false.</p><p>Adem&aacute;s, hay que actualizar el recurso de user para que acepte la modificaci&oacute;n:</p><p id=\"internal-source-marker_0.3294120250320294\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline\">&lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;</span></p><p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;user&gt;</span></p><p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;banned&gt;false&lt;/banned&gt;</span></p><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/user&gt;</span><br /><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(67,27,'marcoantonio.sanz@bbva.com',NULL,'2013-01-02 10:09:24','<p>Set Priority:Alta</p><p>Description:</p><p><div>Dentro de GET listado de usuarios se cambia:</div><div>tagIds por tags</div><div>userIds por users</div><div><br /></div><div>Dentro de DELETE usuarios con filtro se cambia:</div><div>tagIds por tags</div><div>userIds por users</div><div><br /></div><div>(revisar el borrado de un dispositivo de un usuario porque tiene que ser devices el nombre del par&aacute;metro del filtro)</div><div><br /></div><div>Dentro de POst asociaci&oacute;n de tags a un usuario</div><div>cambiar tagIds por tags</div><div>cambiar el failed tambi&eacute;n de tagIds por tags</div><div><br /></div><div>Desasociar tags de un usuario</div><div>cambiar tagIds por tags (tanto en el cuerpo como en el failed)</div><div>cambiar el failed tambi&eacute;n de tagIds por tags</div><div><br /></div><div><br /></div><div>Asociar/Desasociar (POST / DELETE) usuarios a un tag</div><div>cambiar userIds por users</div><div><br /></div><div>Cambiar el failed de userIds por users</div><div><br /></div><div>En listado de tags de un usuario&nbsp;</div><div>cambiar tagIds por tags</div><div><br /></div></p>','',''),(68,27,NULL,2,'2013-01-02 10:10:33','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(69,28,'marcoantonio.sanz@bbva.com',NULL,'2013-01-03 10:03:14','<p>Set Priority:Alta</p><p>Description:</p><p><p>Se deber&aacute; agregar un campo a la tabla que registra las aplicaciones que indique si la aplicaci&oacute;n m&oacute;vil va a responder que le ha llegado del mensaje o no. Habr&aacute; que ampliar el servicio de aplicaciones para recibir este campo.</p><p>&nbsp;Adem&aacute;s, habr&aacute; que enviar el id de env&iacute;o al m&oacute;vil dentro de los campos extra. Debemos estudiar si en blackberry&nbsp;funciona igual que Android, IOS o Windows Phone.</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(70,28,NULL,2,'2013-01-03 10:04:36','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(71,29,'marcoantonio.sanz@bbva.com',NULL,'2013-01-03 10:40:23','<p>Set Priority:Alta</p><p>Description:</p><p><p>Para el uso de las estad&iacute;sticas y del nuevo servicio para comprobar los mensajes que han llegado dentro de una notificaci&oacute;n hay que registrar en las tablas de Amazon la siguiente informaci&oacute;n:</p><p>tabla &lt;prefijo&gt;-notification</p><p>habr&aacute; que registrar:</p><p>id: Id de la notificaci&oacute;n</p><p>tags: tags a los que se ha enviado la notificaci&oacute;n</p><p>type: tipo de la notificaci&oacute;n</p><p>platforms: plataformas</p><p>users: Usuarios a los que se ha enviado la notificaci&oacute;n (s&oacute;lo los que se ponen dentro de la notificaci&oacute;n)</p><p>devices: Dispositivos a los que se ha enviado la notificaci&oacute;n</p><p>status: sending / sent/ completed&nbsp;</p><p>&nbsp; &nbsp;sending: &nbsp;si todav&iacute;a se est&aacute;n enviando los mensajes</p><p>&nbsp; &nbsp;sent: cuando se hayan enviado todos</p><p>&nbsp; &nbsp;partial completed: cuando se han recibido el ack de algunos mensajes&nbsp;</p><p>&nbsp; &nbsp;completed: &nbsp;cuando se han recibido todos los ack de los mensajes</p><p>requested_messages: n&uacute;mero de mensajes &nbsp;que se han creado&nbsp;</p><p><span style=\"color: #2a2a2a; font-family: \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px\">received</span>_messages: n&uacute;mero de mensajes que el m&oacute;vil a respondido.</p><p>Tabla &lt;prefijo&gt;-&lt;platform&gt;-message (representa el env&iacute;o &nbsp;a un dispositivo en concreto (Amazon recomienda que lo dividamos en dominios, para sortear los l&iacute;mites de peticiones que existen por dominio). Los campos ser&iacute;an:</p><p>- id notification: Id de la notificaci&oacute;n</p><p>- Id message: Id del env&iacute;o &nbsp;</p><p>-status: &nbsp;<span style=\"color: #2a2a2a; font-family: \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px\">received</span>&nbsp;/ sent / queued</p><p>&nbsp; &nbsp;received: recibido</p><p>&nbsp; &nbsp;sent: enviado pero el dispositivo todav&iacute;a no ha contestado</p><p>&nbsp; &nbsp;queued: encolado (pero todav&iacute;a no se ha enviado al dispositivo).</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(72,29,NULL,2,'2013-01-03 10:46:29','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(73,30,'marcoantonio.sanz@bbva.com',NULL,'2013-01-03 10:52:35','<p>Set Priority:Normal</p><p>Description:</p><p><p>Se deber&aacute; realizar un env&iacute;o que nos indique el estado de una notificaci&oacute;n</p><p>el servicio debe tener la ruta:</p><p>GET /notification/&lt;id notification&gt;</p><p>y los campos a responder</p><p>&lt;status&gt;</p><p>&lt;request_messages&gt;</p><p>&lt;received_messages&gt;</p><p>(siempre bajo el formato &nbsp;de respuesta est&aacute;ndar)</p></p>','',''),(74,31,'marcoantonio.sanz@bbva.com',NULL,'2013-01-03 10:56:34','<p>Set Priority:Normal</p><p>Description:</p><p><p>Habr&aacute; que realizar dos servicios, uno de comprobaci&oacute;n del message y otro de entrega del mensaje.</p><p>Servicio de recepci&oacute;n del mensaje (para el dispositivo):&nbsp;</p><p>&nbsp;POST message/id_message</p><p>body:</p><p>&lt;status&gt;received&lt;/received&gt;</p><p>Servicio de comprobaci&oacute;n del estado del mensaje:</p><p>GET message/id_message</p><p>&lt;status&gt; &nbsp; &lt;/status&gt;</p><p>&lt;id_notification&gt; &nbsp;&lt;/id_notification&gt;</p><p>&lt;platform&gt; &lt;/platform&gt;&nbsp;</p><p>&nbsp;</p></p>','',''),(75,30,NULL,2,'2013-01-03 10:57:15','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(76,31,NULL,2,'2013-01-03 10:57:41','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(77,32,'marcoantonio.sanz@bbva.com',NULL,'2013-01-04 10:16:34','<p>Set Priority:Normal</p><p>Description:</p><p><p>Cuando env&iacute;amos una notificaci&oacute;n y ponemos los tags / users / devices deber&iacute;a funcionar como un OR y no como un AND. Me explico,</p><p>&nbsp;</p><div class=\"kk\"><span>si env&iacute;o una notificaci&oacute;n al grupo vips, usuario: Marco y dispositivo XXX1</span></div><div id=\":18t\" dir=\"ltr\" class=\"kl\">yo  entiendo que la notificaci&oacute;n deber&iacute;a enviarse a todos los dispositivos  de los usuarios del grupo vips + dispositivos usuario Marco (si no est&aacute;  incluido en el grupo) + dispositivo XXX1 (si no est&aacute; en ninguno de los  grupos anteriores)</div><p>&nbsp;</p></p>','',''),(78,32,NULL,2,'2013-01-04 10:39:04','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(79,12,NULL,2,'2013-01-04 10:39:50','<p>Set Priority:Normal,Status: Closed</p><p>Description:</p><p>Se han creado ya los requisitos espec&iacute;ficos.</p>','',''),(80,22,NULL,2,'2013-01-04 10:40:09','<p>Set Priority:Normal,Status: Closed</p><p>Description:</p><p>Se han creado otros requisitos m&aacute;s espec&iacute;ficos.</p>','',''),(81,26,NULL,2,'2013-01-04 10:40:37','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(82,19,NULL,2,'2013-01-04 10:41:06','<p>Set Priority:Alta,Status: Suspended</p><p>Description:</p><p>La base de datos se debe migrar a Mysql.</p>','',''),(83,11,NULL,2,'2013-01-04 10:42:38','<p>Set Priority:Normal,Status: Closed</p><p>Description:</p><p>Ya he creado unas peticiones m&aacute;s espec&iacute;ficas.</p>','',''),(84,19,NULL,2,'2013-01-04 10:43:10','<p>Set Priority:Alta,Status: In process</p><p>Description:</p><p></p>','',''),(85,33,'marcoantonio.sanz@bbva.com',NULL,'2013-01-08 14:31:26','<p>Set Priority:Alta</p><p>Description:</p><p>Si intentamos deshabilitar un dispositivo con la versi&oacute;n 0.5 el dispositivo no se queda deshabilitado (entorno sandbox).</p>','',''),(86,33,NULL,2,'2013-01-08 14:33:15','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(87,13,NULL,0,'2013-01-08 14:50:55','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(88,27,NULL,0,'2013-01-08 15:00:53','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(89,25,NULL,0,'2013-01-08 15:02:47','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(90,24,NULL,0,'2013-01-08 15:03:23','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(91,8,NULL,0,'2013-01-08 16:07:19','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(92,23,NULL,0,'2013-01-08 17:08:41','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(93,30,NULL,0,'2013-01-23 16:30:46','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(94,19,NULL,0,'2013-01-23 17:46:26','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(95,34,'marcoantonio.sanz@bbva.com',NULL,'2013-01-24 13:17:24','<p>Set Priority:Normal</p><p>Description:</p><p><p>Introducir:</p><p>deviceInactive=true/false</p><p>deviceDisabled=true/false</p><p>banned=true/false</p><p>&nbsp;</p></p>','',''),(96,35,'marcoantonio.sanz@bbva.com',NULL,'2013-01-24 13:18:59','<p>Set Priority:Normal</p><p>Description:</p><p><p id=\"internal-source-marker_0.5661576269493277\" style=\"t