71HL2OG9Im4hbxntJjKO1FoB0_O3GMDxPAHs1xrs75HHGs5PISCsQHtoh2vN6RYbVeCLfRpwmAk8jAIlVfVUc6tRoCsFFMeRQ8rFC0DKVuFstZyLIUqR1Ubk_0mMq3Swibx2</p></p>','',''),(114,38,NULL,2,'2013-02-25 11:30:23','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(115,39,'marcoantonio.sanz@bbva.com',NULL,'2013-03-01 10:05:45','<p>Set Priority:Muy Alta</p><p>Description:</p><p><p>Se debe configurar el entorno (de ios principalmente) que se quiere utilizar por cada aplicaci&oacute;n. As&iacute; podremos tener algunas aplicaciones que tiren de sanbox y otras que tiren directamente del entorno de producci&oacute;n. Hay que tener en cuenta que para wp (aunque con menor prioridad) tambi&eacute;n habr&iacute;a diferencias, y todav&iacute;a no se si tambi&eacute;n habr&iacute;a diferencias con blackberry (vamos, primero hacemos la implementaci&oacute;n, tenemos en cuenta ios, lo subimos, provamos y con menor prioridad hacemos la implementaci&oacute;n para windows phone.</p><p>&nbsp;Un saludo. </p></p>','',''),(116,39,NULL,2,'2013-03-01 10:09:04','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(117,37,NULL,2,'2013-03-01 10:09:32','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(118,36,NULL,2,'2013-03-01 10:09:58','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(119,40,'marcoantonio.sanz@bbva.com',NULL,'2013-03-01 10:11:51','<p>Set Priority:Muy Alta</p><p>Description:</p><p>Se debe tener en cuenta para el manager que ya no se devuelve el nodo notiifcation_response en las respuestas por json.</p>','',''),(120,40,NULL,2,'2013-03-01 10:12:16','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(121,41,'marcoantonio.sanz@bbva.com',NULL,'2013-03-06 19:44:05','<p>Set Priority:Baja</p><p>Description:</p><p>Se debe enviar el campo &quot;extra&quot; &nbsp;tal y como se recibe de la notificaci&oacute;n (si ponemos un &lt;user&gt; prueba&lt;/user&gt; deber&iacute;a llegar lo mismo, y no un json como ahora.</p>','',''),(122,42,'marcoantonio.sanz@bbva.com',NULL,'2013-03-07 16:30:19','<p>Set Priority:Baja</p><p>Description:</p><p>Al poner una plataforma inexistente deber&iacute;a mandarnos un mensaje de error.</p>','',''),(123,43,'marcoantonio.sanz@bbva.com',NULL,'2013-03-07 16:45:35','<p>Set Priority:Normal</p><p>Description:</p><p>Al intentar actualizar una aplicaci&oacute;n y a&ntilde;adirle una nueva plataforma la aplicaci&oacute;n me muestra un error.</p>','',''),(124,44,'marcoantonio.sanz@bbva.com',NULL,'2013-03-12 13:08:15','<p>Set Priority:Normal</p><p>Description:</p><p><div>Los requisitos son los siguientes:&nbsp;</div><div>&nbsp;</div><div>- Al dar de alta la aplicaci&oacute;n, se puede dar de alta la plataforma  direct-email. Los emails que est&eacute;n dentro del campo email, ser&aacute;n los  &uacute;nicos que son remitentes. Si la plataforma no est&aacute; activa, no se podr&aacute;  enviar emails.</div> <div>- La plataforma direct-email no puede ir con otras plataformas.</div><div>- Se podr&aacute;n enviar emails a varios destinatarios.</div><div>-  La notificaci&oacute;n funciona como cualquier otra plataforma, por lo que se  guarda en amazon las estad&iacute;sticas y se puede consultar la informaci&oacute;n de  la plataforma &nbsp;(se puede invocar al servicio getNotification para saber  el n&uacute;mero de mensajes que se ha creado).</div> <div><br /></div><div>C&oacute;digos de error y validaciones:</div><div>404 El email ($mailFrom) no est&aacute; registrado para poder enviar emails dentro de la aplicaci&oacute;n.</div><div>404&nbsp;la plataforma \'.$platid.\' no se encuentra activa para la aplicaci&oacute;n</div> <div>400 El email ($email) no es correcto</div><div>400 direct-email no puede ir junto con otras plataformas</div><div>&nbsp;</div><div>&nbsp;</div></p>','',''),(125,44,NULL,2,'2013-03-12 13:09:01','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(126,45,'marcoantonio.sanz@bbva.com',NULL,'2013-03-20 12:32:58','<p>Set Priority:Alta</p><p>Description:</p><p>Si al enviar una notificaci&oacute;n ponemos como plataforma &quot;push&quot; la plataforma nos devuelve un error si la aplicaci&oacute;n no tiene todas las plataformas activas.</p>','',''),(127,46,'marcoantonio.sanz@bbva.com',NULL,'2013-03-20 12:34:39','<p>Set Priority:Normal</p><p>Description:</p><p>Si se env&iacute;a una notificaci&oacute;n a varias plataformas, y una de ellas no se encuentra activa, se env&iacute;a un mensaje a las plataformas activas (dependiendo del orden) aunque al usuario se le devuelve un error.</p>','',''),(128,47,'marcoantonio.sanz@bbva.com',NULL,'2013-03-20 12:36:08','<p>Set Priority:Baja</p><p>Description:</p><p>Se est&aacute;n enviando notificaciones al SNS aunque no existan mensajes en la cola.</p>','',''),(129,42,NULL,2,'2013-03-20 12:38:16','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(130,43,NULL,2,'2013-03-20 12:38:49','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(131,45,NULL,2,'2013-03-20 12:39:23','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(132,46,NULL,2,'2013-03-20 12:39:48','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(133,47,NULL,2,'2013-03-20 12:40:24','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(134,41,NULL,2,'2013-03-20 12:40:50','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(135,47,NULL,0,'2013-03-20 12:54:19','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(136,46,NULL,0,'2013-03-20 13:06:41','Your report has been closed because the report is [Rea