nbsp;&nbsp;&nbsp; &quot;android&quot;: {<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;appVersion&quot;: &quot;1.0&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  &quot;token&quot;:  &quot;APA91bE_8UgjpeK7gFOUTcw_UgMIrjGSdBo5fy1eNQizM0-2u0SZ7_qwTLiTaaqbfE555_6ce2qxklw7tzyzjYvqNC_3LBA-x4tpNORDOUKd8jcKUWX5ElgrTvRg6Dhpbsoh6T1Zz3bV&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;deviceAlias&quot;: &quot;Tel&eacute;fono del trabajo&quot;,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &quot;disabled&quot;: &quot;true&quot;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }<br />&nbsp;&nbsp;&nbsp; }<br />&nbsp; }<br />}</p><p>&quot;user&quot; podr&iacute;a venir como &quot;USER&quot;,&quot;user&quot;... y as&iacute; con disabled, deviceAlias...</p><p>en las urls tambi&eacute;n:</p><p>http://push.gobernalianet.es/users?tags=vip&amp;platforms=android&amp;appVersion=1.0</p><p>tags podr&iacute;a venir como TAGS, tAgs.. y el resto de par&aacute;metros igual.&nbsp;</p><p>&nbsp;Sin embargo, http://push.gobernalianet.es/users/androidUser</p><p>la  url en s&iacute; misma no tiene que ser no case sensitive, es decir, para  actulizar el usuario androidUser deber&iacute;an poner la url  &quot;http://push.gobernalianet.es/users/androidUser&quot;</p><p>Hay que tener en cuenta que hay que ser compatible con lo existente. </p></p>','',''),(79,32,2,'2012-10-18 15:05:51','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:jelingan</p><p>Description:</p><p><p>odos los par&aacute;metros de entradas (los que van en el body como en la petici&oacute;n ser&aacute;n no case sensitive).<br /><br />En   los par&aacute;metros de salida se cambiar&aacute; en todos los servicios que   devuelven los dispositivos: devicealias y deviceid por deviceAlias y   deviceId<br /> <br />Se cambiar&aacute; enabled por disabled en los siguientes  servicios tanto  en el body (en crear usuario, actualizar usuario..)  como en los  par&aacute;metros de respuesta (cuando se listan dispositivos)-<br /><br />Dentro de los par&aacute;metro del listado de usuarios se cambia appVersion por appVersions<br /> <br />Dentro del borrado de usuarios &quot;device&quot; por deviceIds y tags por tagIds, versions por appVersions<br /><br />Dentro de las notificaciones: cambiar tags por tagIds, users por userIds y devices por deviceIds, type por typeId.<br /> <br />Dentro&nbsp; de asociar usuarios a un tag: cambiar users por userIds tanto en el body como en la respuesta<br /><br />Dentro&nbsp;   de Asociar / desasociar usuarios a tags se cambia tags por tagIds   (tambi&eacute;n en la respuesta cuando no se puede asociar (dentro del failed)<br /> <br />Dentro del listado de tags de un usuario : tags por tagIds tanto en el body como en la respuesta<br /><br />Cambiar name dentro del type por typeName.<br /><br /><br />He realizado una colecci&oacute;n y he actualizado el API.<br /><br /> <a href=\"https://docs.google.com/a/bbvaglobalnet.com/file/d/0ByYvNo6IacyDamFfT3ZfdFhOLUU/edit\" target=\"_blank\">https://docs.google.com/a/bbvaglobalnet.com/file/d/0ByYvNo6IacyDamFfT3ZfdFhOLUU/edit</a><br /><br />Un saludo.</p></p>','',''),(80,33,2,'2012-10-22 14:03:51','<p>Set Priority:Alta, \n	Status:Aplazado, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(81,34,2,'2012-10-24 09:53:43','<p>Set Priority:Alta, \n	Status:En proceso, Assign To:jelingan</p><p>Description:</p><p>Al listar un dispositivo se muestra dentro de la salida un array de informaci&oacute;n</p>','',''),(82,33,3,'2012-10-25 18:12:53','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(83,32,3,'2012-10-25 18:13:38','<p>Set Priority:Alta, Status:<font color=red>En proceso</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(84,31,3,'2012-10-25 18:14:11','<p>Set Priority:Alta, Status:<font color=red>En proceso</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(85