v><br /></div><div>Dentro de DELETE usuarios con filtro se cambia:</div><div>tagIds por tags</div><div>userIds por users</div><div><br /></div><div>(revisar el borrado de un dispositivo de un usuario porque tiene que ser devices el nombre del par&aacute;metro del filtro)</div><div><br /></div><div>Dentro de POst asociaci&oacute;n de tags a un usuario</div><div>cambiar tagIds por tags</div><div>cambiar el failed tambi&eacute;n de tagIds por tags</div><div><br /></div><div>Desasociar tags de un usuario</div><div>cambiar tagIds por tags (tanto en el cuerpo como en el failed)</div><div>cambiar el failed tambi&eacute;n de tagIds por tags</div><div><br /></div><div><br /></div><div>Asociar/Desasociar (POST / DELETE) usuarios a un tag</div><div>cambiar userIds por users</div><div><br /></div><div>Cambiar el failed de userIds por users</div><div><br /></div><div>En listado de tags de un usuario&nbsp;</div><div>cambiar tagIds por tags</div><div>&nbsp;</div><div>Mantener compatibilidad con esta versi&oacute;n (vamos que tenemos que tener en cuenta tanto userIds como users...)&nbsp;</div></p>','',''),(125,46,2,'2013-01-02 10:11:02','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(126,45,2,'2013-01-02 10:11:19','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(127,43,2,'2013-01-02 10:11:38','<p>Set Priority:Baja, Status:En proceso(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(128,47,2,'2013-01-03 10:04:36','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p><p>Se deber&aacute; agregar un campo a la tabla que registra las aplicaciones que indique si la aplicaci&oacute;n m&oacute;vil va a responder que le ha llegado del mensaje o no. Habr&aacute; que ampliar el servicio de aplicaciones para recibir este campo.</p><p>&nbsp;Adem&aacute;s, habr&aacute; que enviar el id de env&iacute;o al m&oacute;vil dentro de los campos extra. Debemos estudiar si en blackberry&nbsp;funciona igual que Android, IOS o Windows Phone.</p><p>&nbsp;Debemos modificar tambi&eacute;n el Manager para mostrar y recoger este campo.&nbsp;</p></p>','',''),(129,48,2,'2013-01-03 10:46:29','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p><p>Para el uso de las estad&iacute;sticas y del nuevo servicio para comprobar los mensajes que han llegado dentro de una notificaci&oacute;n hay que registrar en las tablas de Amazon la siguiente informaci&oacute;n:</p><p>tabla &lt;prefijo&gt;-notification</p><p>habr&aacute; que registrar:</p><p>id: Id de la notificaci&oacute;n</p><p>tags: tags a los que se ha enviado la notificaci&oacute;n</p><p>type: tipo de la notificaci&oacute;n</p><p>platforms: plataformas</p><p>users: Usuarios a los que se ha enviado la notificaci&oacute;n (s&oacute;lo los que se ponen dentro de la notificaci&oacute;n)</p><p>devices: Dispositivos a los que se ha enviado la notificaci&oacute;n</p><p>status: sending / sent/ completed&nbsp;</p><p>&nbsp; &nbsp;sending: &nbsp;si todav&iacute;a se est&aacute;n enviando los mensajes</p><p>&nbsp; &nbsp;sent: cuando se hayan enviado todos</p><p>&nbsp; &nbsp;partial completed: cuando se han recibido el ack de algunos mensajes&nbsp;</p><p>&nbsp; &nbsp;completed: &nbsp;cuando se han recibido todos los ack de los mensajes</p><p>requested_messages: n&uacute;mero de mensajes &nbsp;que se han creado&nbsp;</p><p><span style=\"color: #2a2a2a; font-family: \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px\">received</span>_messages: n&uacute;mero de mensajes que el m&oacute;vil a respondido.</p><p>Tabla &lt;prefijo&gt;-&lt;platform&gt;-message (representa el env&iacute;o &nbsp;a un dispositivo en concreto (Amazon recomienda que lo dividamos en dominios, para sortear los l&iacute;mites de peticiones que existen por dominio). Los campos ser&iacute;an:</p><p>- id notification: Id de la notificaci&oacute;n</p><p>- Id message: Id del env&iacute;o &nbsp;</p><p>-status: &nbsp;<span style=\"color: #2a2a2a; font-family: \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px\">received</span>&nbsp;/ sent / queued</p><p>&nbsp; &nbsp;received: recibido</p><p>&nbsp; &nbsp;sent: enviado pero el dispositivo todav&iacute;a no ha contestado</p><p>&nbsp; &nbsp;queued: encolado (pero todav&iacute;a no se ha enviado al dispositivo).</p><div><br /></div></p>','',''),(130,49,2,'2013-01-03 10:57:15','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p><p>Se deber&aacute; realizar un env&iacute;o que nos indique el estado de una notificaci&oacute;n</p><p>el servicio debe tener la ruta:</p><p>GET /notification/&lt;id notification&gt;</p><p>y los campos a responder</p><p>&lt;status&gt;</p><p>&lt;request_messages&gt;</p><p>&lt;received_messages&gt;</p><p>(siempre bajo el formato &nbsp;de respuesta est&aacute;ndar)</p></p>','',''),(131,50,2,'2013-01-03 10:57:41','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p><p>Habr&aacute; que realizar dos servicios, uno de comprobaci&oacute;n del message y otro de entrega del mensaje.</p><p>Servicio de recepci&oacute;n del mensaje (para el dispositivo):&nbsp;</p><p>&nbsp;POST message/id_message</p><p>body:</p><p>&lt;status&gt;received&lt;/received&gt;</p><p>Servicio de comprobaci&oacute;n del estado del mensaje:</p><p>GET message/id_message</p><p>&lt;status&gt; &nbsp; &lt;/status&gt;</p><p>&lt;id_notification&gt; &nbsp;&lt;/id_notification&gt;</p><p>&lt;platform&gt; &lt;/platform&gt;&nbsp;</p><div><br /></div></p>','',''),(132,49,2,'2013-01-03 10:58:15','<p>Set Priority:Normal, Status:Aplazado(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(133,48,2,'2013-01-03 10:58:29','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(134,47,2,'2013-01-03 10:58:39','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(135,47,2,'2013-01-03 11:23:30','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p>El campo puede llamarse send_ack. Hay que modificar tanto la petici&oacute;n GET como el POST / PUT (modificaci&oacute;n y creaci&oacute;n de la aplicaci&oacute;n)</p>','',''),(136,48,2,'2013-01-03 11:32:52','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p>A&ntilde;adir los campos userid,deviceid</p>','',''),(137,48,2,'2013-01-03 12:01:34','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p><p>Este campo no hace falta: r<span style=\"color: #2a2a2a; font-family: \'Segoe UI\', \'Lucida Grande\', Verdana, Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px\">eceived</span>_messages.&nbsp;</p><p>Como van a ver menos consultas a la tabla notification que actualizaciones en la message, dejamos la actualizaci&oacute;n del estado cuando se consulte por la notificaci&oacute;n. &nbsp;</p></p>','',''),(138,48,2,'2013-01-03 12:08:56','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p><p>Dividir los dominios por m&oacute;dulo. (en principio 10). Es decir, cogemos el id de message, lo pasamos a num&eacute;rico y calculamos el m&oacute;dulo. Por lo tanto, existir&aacute;n 10 dominios...</p><p>ejemplo:</p><p>id message:1</p><p>1 mod 10: 1</p><p>se guardar&iacute;a en &lt;pref&gt;-message-1</p><p>11 mod 10: 1</p><p>se guardar&iacute;a tambi&eacute;n en &lt;pref&gt;-message-1&nbsp;</p><p>&nbsp;</p><p>El n&uacute;mero de dominios debe ser una variable global.&nbsp;</p></p>','',''),(139,50,2,'2013-01-03 12:11:28','<p>Set Priority:Normal, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p><p>el del mensaje es un PUT (modificaci&oacute;n del estado), no un POST.</p><p>&nbsp;</p><p>A&ntilde;&aacute;dir los campos en el GET de:</p><p>&lt;userid&gt;</p><p>&lt;deviceid&gt;&nbsp;</p></p>','',''),(140,50,2,'2013-01-03 12:21:15','<p>Set Priority:Normal, Status:Aplazado(active), Assign To:dmiranda</p><p>Description:</p><p><p>yo pondr&iacute;a &lt;pref&gt;-nxt-message-1</p><p>nxt-message-2</p><p>nxt-message-3</p><p>... es decir, dividir&iacute;a por app_id y por m&oacute;dulo del id de message.</p><p>&nbsp;</p></p>','',''),(141,51,2,'2013-01-04 10:37:34','<p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p><p>Si intentamos actualizar el dispositivo utilizando el id del dispositivo se produce un error. La regla de negocio es la siguiente:</p><p>- Si ponemos oldToken y actualToken &nbsp;se actualiza por oldToken.</p><p>- Si ponemos actualToken y no ponemos deviceId se actualiza por actualToken.</p><p>- Siempre que venga deviceId se actualiza por deviceId (aunque venga actualToken...)</p><p>&nbsp;Un saludo.&nbsp;</p></p>','',''),(142,52,2,'2013-01-04 10:39:04','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p><p>Cuando env&iacute;amos una notificaci&oacute;n y ponemos los tags / users / devices deber&iacute;a funcionar como un OR y no como un AND. Me explico,</p><p>&nbsp;</p><div class=\"kk\">si env&iacute;o una notificaci&oacute;n al grupo vips, usuario: Marco y dispositivo XXX1</div><div id=\":18t\" dir=\"ltr\" class=\"kl\">yo entiendo que la notificaci&oacute;n deber&iacute;a enviarse a todos los dispositivos de los usuarios del grupo vips + dispositivos usuario Marco (si no est&aacute; incluido en el grupo) + dispositivo XXX1 (si no est&aacute; en ninguno de los grupos anteriores)</div></p>','',''),(143,53,2,'2013-01-04 10:40:37','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p><p>Description:</p><p>&nbsp;</p><p>Se deber&aacute; poner a nivel de usuario la propiedad banned. Por lo tanto, deja de ser un tag especial (vamos un tag) y se utilizar&aacute; como estado.</p><p>Adem&aacute;s, hay que ponerlo como par&aacute;metro de entrada en buscar usuarios y eliminar usuarios para que se puedan buscar y eliminar (ver API). Tambi&eacute;n hay que meter el par&aacute;metro deviceDisabled= y deviceInactive=true/false. adem&aacute;s de userBanned=true/false.</p><p>Adem&aacute;s, hay que actualizar el recurso de user para que acepte la modificaci&oacute;n:</p><p id=\"internal-source-marker_0.3294120250320294\" style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline\">&lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;</span></p><p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;user&gt;</span></p><p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt\" dir=\"ltr\"><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;banned&gt;false&lt;/banned&gt;</span></p><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/user&gt;</span><br /><div><span style=\"font-size: 12px; font-family: \'Courier New\'; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline\"><br /></span></div></p>','',''),(144,54,2,'2013-01-08 14:33:15','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p><p>Si intentamos deshabilitar un dispositivo con la versi&oacute;n 0.5 el dispositivo no se queda deshabilitado (entorno sandbox).</p><p>No se habilitan / deshabilitan los dispositivos y por lo tanto, no se controla que no se env&iacute;en notificaciones a dispositivos deshabilitados (lo he probado en la versi&oacute;n anterior del Mysql).</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(145,28,2,'2013-01-08 14:38:10','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font><br>Old reported by customer:, New reported by customer:<font color=\"red\">PFD</font></p><p>Description:</p><p></p>','',''),(146,29,2,'2013-01-08 14:50:55','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(147,34,2,'2013-01-08 14:51:31','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(148,35,2,'2013-01-08 14:52:18','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(149,36,2,'2013-01-08 14:52:58','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(150,37,2,'2013-01-08 14:53:21','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(151,38,2,'2013-01-08 14:54:14','<p>Set Priority:Normal, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font><br>