riority:Normal, Status:Aplazado(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(245,59,2,'2013-01-22 12:48:04','<p>Set Priority:Alta, Status:Aplazado(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(246,55,2,'2013-01-22 12:48:24','<p>Set Priority:Normal, Status:Realizado. Pendiente de validación(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(247,50,2,'2013-01-22 12:48:43','<p>Set Priority:Normal, Status:En proceso(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(248,49,2,'2013-01-22 12:49:07','<p>Set Priority:Normal, Status:Realizado. Pendiente de validación(active), Assign To:dmiranda</p><p>Description:</p><p></p>','',''),(249,48,2,'2013-01-22 12:49:23','<p>Set Priority:Alta, Status:Realizado. Pendiente de validación(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(250,49,2,'2013-01-22 12:49:37','<p>Set Priority:Normal, Status:Realizado. Pendiente de validación(active), Assign To:<font color=red>jelingan</font></p><p>Description:</p><p></p>','',''),(251,48,2,'2013-01-22 12:51:32','<p>Set Priority:Alta, Status:Realizado. Pendiente de validación(active), Assign To:jelingan</p><p>Description:</p><p>los campos que son &quot;fecha&quot; en amazon deber&iacute;amos guardarlos como un timestamp. Porque si alg&uacute;n d&iacute;a tenemos que revisar la internacionalizaci&oacute;n va a ser muy complicado cambiarlo...</p>','',''),(252,48,2,'2013-01-22 13:13:21','<p>Set Priority:Alta, Status:Realizado. Pendiente de validación(active), Assign To:jelingan</p><p>Description:</p><p><p>A&ntilde;adir el campo &quot;receivedDate&quot; a la tabla messages y guardar la fecha en que se envi&oacute;.</p><p>Adem&aacute;s, revisar la gesti&oacute;n de dominios de cada tabla. Si es n</p><p>otification:</p><p>- El nombre de la tabla debe ser &lt;prefix&gt;_NOTIFICATION_&lt;ID_APLICACION&gt;_SLOT</p><p>Tanto el&nbsp; n&uacute;mero de slots como los slots activos deben guardarse dentro de la aplicaci&oacute;n a la que pertenecen. As&iacute; deber&iacute;a funcionar de la siguiente forma:</p><p>=&gt; si recibimos una notificaci&oacute;n. Mirar n&uacute;mero de slots y slots activos. Por ejemplo&nbsp; numDomainApplication=3&nbsp;&nbsp; domainActiveApplication=&quot;A,B,C&quot;</p><p>entonces recibimos la notificaci&oacute;n 1,2,3 y deber&iacute;amos realizar: </p><p>&nbsp;1 mod 3 = 1 id notificaci&oacute;n: 1B</p><p>2 mod 3 = 2 id notificaci&oacute;n: 2 C</p><p>3 mod 3 = 0 id notificaci&oacute;n 3 A</p><p>Si llega la notificaci&oacute;n 4, y le toca el dominio B (4 mod 3 = 1 id notificaci&oacute;n: 4B ) que ha superado el l&iacute;mite de 10 GB, entonces hay que hacer las siguientes&nbsp; operaciones:</p><p>1 ) Creamos el dominio&nbsp; &lt;prefix&gt;_NOTIFICATION_&lt;ID_APLICACION&gt;_D</p><p>2) Actualizamos lista de dominios activos&nbsp; domainActiveApplication=&quot;A,C,D&quot;</p><p>y entonces calculamos en qu&eacute; dominio hay que guardarla:</p><p>4 mod 3 = 1 ID Notificaci&oacute;n 4C </p><p>Si nos damos cuenta que la aplicaci&oacute;n necesita m&aacute;s dominios para trabajar, se deber&aacute; permitir actualizar el numDOmainApplication = 5. En este caso, al modificar la aplicaci&oacute;n (llamar al m&eacute;todo PUT de XXX/application/&lt;id_application&gt; deber&iacute;amos hacer las siguientes operaciones:</p><p>1) Actualizar el numDomainApplication = 5</p><p>2) Crear los nuevos dominios. En este caso:</p><p>&lt;prefix&gt;_NOTIFICATION_&lt;ID_APLICACION&gt;_E</p><p>&lt;prefix&gt;_NOTIFICATION_&lt;ID_APLICACION&gt;_F</p><p>3) Actualizar el domainActiveApplication =  domainActiveApplication=&quot;A,C,D,E,F&quot;</p><p>as&iacute; si llega la notificaci&oacute;n 5,6,7,8,9 se har&iacute;a lo siguiente:</p><p>5 mod 5 = 0 id not: 5A</p><p>6 mod 5 = 1 id not: 1C</p><p>7 mod 5 = 2 id not: 7D</p><p>8 mod 5 = 3 id not:8E</p><p>9 mod 5 = 4 id not:9F</p><p>&nbsp;Cuando llegue un get XXX/notification/9F entonces deber&iacute;amos consultar la notificaci&oacute;n que se encuentra en el dominio &lt;prefix&gt;_NOTIFICATION_&lt;ID_APLICACION&gt;_F </p></p>','',''),(253,68,2,'2013-01-22 13:17:13','<p>Set Priority:Normal, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font><br>Old reported by customer:, New reported by customer:<font color=\"red\">PFD</font></p><p>Description:</p><p></p>','',''),(254,55,2,'2013-01-22 13:18:28','<p>Set Priority:Normal, Status:Realizado. Pendiente de validación(active), Assign To:jelingan</p><p>Description:</p><p>Sigue mostr&aacute;ndose</p>','',''),(255,58,3,'2013-01-22 17:05:20','<p>Set Priority:Baja, Status:<font color=red>En proceso</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(256,53,3,'2013-01-22 17:29:02','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(257,70,3,'2013-01-22 17:31:51','<p>Set Priority:Baja, Status:<font color=red>No se puede reproducir</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(258,63,3,'2013-01-22 17:32:27','<p>Set Priority:Alta, Status:<font color=red>En proceso</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(259,63,3,'2013-01-22 19:06:48','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(260,58,3,'2013-01-22 19:07:13','<p>Set Priority:Baja, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(261,57,3,'2013-01-22 19:18:34','<p>Set Priority:Normal, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:jelingan</p><p>Description:</p><p></p>','',''),(262,59,3,'2013-01-23 12:45:27','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign