el manager que ya no se devuelve el nodo notiifcation_response en las respuestas por json.</p></p>','',''),(444,99,2,'2013-03-12 13:09:01','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Realizado y verificado, Assign To:marco.sanz</p><p>Description:</p><p><div>&nbsp;</div><div>- Al dar de alta la aplicaci&oacute;n, se puede dar de alta la plataforma direct-email. Los emails que est&eacute;n dentro del campo email, ser&aacute;n los &uacute;nicos que son remitentes. Si la plataforma no est&aacute; activa, no se podr&aacute; enviar emails.</div><div>- La plataforma direct-email no puede ir con otras plataformas.</div><div>- Se podr&aacute;n enviar emails a varios destinatarios.</div><div>- La notificaci&oacute;n funciona como cualquier otra plataforma, por lo que se guarda en amazon las estad&iacute;sticas y se puede consultar la informaci&oacute;n de la plataforma &nbsp;(se puede invocar al servicio getNotification para saber el n&uacute;mero de mensajes que se ha creado).</div><div><br /></div><div>C&oacute;digos de error y validaciones:</div><div>404 El email ($mailFrom) no est&aacute; registrado para poder enviar emails dentro de la aplicaci&oacute;n.</div><div>404&nbsp;la plataforma \'.$platid.\' no se encuentra activa para la aplicaci&oacute;n</div><div>400 El email ($email) no es correcto</div><div>400 direct-email no puede ir junto con otras plataformas</div></p>','',''),(445,100,2,'2013-03-20 12:38:16','<p>Import from Customer Feedback</p><p>Set Priority:Baja, \n	Status:Realizado y verificado, Assign To:marco.sanz</p><p>Description:</p><p>Al poner una plataforma inexistente deber&iacute;a mandarnos un mensaje de error.</p>','',''),(446,101,2,'2013-03-20 12:38:49','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Aplazado, Assign To:jelingan</p><p>Description:</p><p>Al intentar actualizar una aplicaci&oacute;n y a&ntilde;adirle una nueva plataforma la aplicaci&oacute;n me muestra un error.</p>','',''),(447,102,2,'2013-03-20 12:39:23','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Realizado. Pendiente de validación, Assign To:marco.sanz</p><p>Description:</p><p>Si al enviar una notificaci&oacute;n ponemos como plataforma &quot;push&quot; la plataforma nos devuelve un error si la aplicaci&oacute;n no tiene todas las plataformas activas.</p>','',''),(448,103,2,'2013-03-20 12:39:48','<p>Import from Customer Feedback</p><p>Set Priority:Normal, \n	Status:Realizado. Pendiente de validación, Assign To:marco.sanz</p><p>Description:</p><p>Si se env&iacute;a una notificaci&oacute;n a varias plataformas, y una de ellas no se encuentra activa, se env&iacute;a un mensaje a las plataformas activas (dependiendo del orden) aunque al usuario se le devuelve un error.</p>','',''),(449,104,2,'2013-03-20 12:40:24','<p>Import from Customer Feedback</p><p>Set Priority:Baja, \n	Status:Realizado. Pendiente de validación, Assign To:marco.sanz</p><p>Description:</p><p>Se est&aacute;n enviando notificaciones al SNS aunque no existan mensajes en la cola.</p>','',''),(450,105,2,'2013-03-20 12:40:50','<p>Import from Customer Feedback</p><p>Set Priority:Baja, \n	Status:Aplazado, Assign To:jelingan</p><p>Description:</p><p>Se debe enviar el campo &quot;extra&quot; &nbsp;tal y como se recibe de la notificaci&oacute;n (si ponemos un &lt;user&gt; prueba&lt;/user&gt; deber&iacute;a llegar lo mismo, y no un json como ahora.</p>','',''),(451,104,2,'2013-03-20 12:53:58','<p>Set Priority:Baja, Status:Realizado. Pendiente de validación(active), Assign To:marco.sanz</p><p>Description:</p><p>He comprobado que no env&iacute;a emails a las plataformas que no tienen usuarios.</p>','',''),(452,104,2,'2013-03-20 12:54:19','<p>Set Priority:Baja, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(453,103,2,'2013-03-20 13:06:41','<p>Set Priority:Normal, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red><