INSERT INTO `proj4_feedback_content_table` VALUES (1,1,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 11:02:12','<p>Set Priority:Alta</p><p>Description:</p><p><p>Realizar la integraci&oacute;n de LEC con Moodle. Para eso, existi?a unas urls que debemos interceptar para recoger el id del curso e invocar a los servicios de moodle tanto para realizar login como para crear el usuario en caso de que no exista.</p><p>&nbsp;La url ser&aacute; del estilo&nbsp;<a href=\"http://preaula.bbvaelearning.com/course/view.php?id=65\">http://preaula.bbvaelearning.com/course/view.php?id=65</a>&nbsp;</p><p>&nbsp;</p></p>','',''),(2,2,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 11:04:19','<p>Set Priority:Alta</p><p>Description:</p><p>Antes de acceder a los cursos, se deber&aacute; mostrar una pantalla de confirmaci&oacute;n si ha le&iacute;do las condiciones legales. Esta respuesta se deber&aacute; guardar en sessi&oacute;n del usuario, para no tener que preguntarlo si en la misma sesi&oacute;n intenta acceder a varios cursos.</p>','',''),(3,3,'marcoantonio.sanz@bbva.com',NULL,'2012-09-11 11:05:31','<p>Set Priority:Alta</p><p>Description:</p><p>Se deber&aacute; extraer la parte de Actualidad de LEC para que pueda aparecer en una p&aacute;gina de Facebook (resoluci&oacute;n recomendada 800X600) sin cabecera, ni pie... S&oacute;lo esa secci&oacute;n.</p>','',''),(4,3,NULL,2,'2012-09-11 11:05:51','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(5,2,NULL,2,'2012-09-11 11:06:07','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(6,1,NULL,2,'2012-09-11 11:06:22','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(7,4,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 12:33:12','<p>Set Priority:Normal</p><p>Description:</p><p></p>','',''),(8,5,'marcoantonio.sanz@bbva.com',NULL,'2012-09-17 12:33:57','<p>Set Priority:Alta</p><p>Description:</p><p></p>','',''),(9,5,NULL,2,'2012-09-17 12:34:48','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(10,4,NULL,2,'2012-09-17 12:35:05','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(11,6,'marcoantonio.sanz@bbva.com',NULL,'2012-09-19 07:41:38','<p>Set Priority:Muy Alta</p><p>Description:</p><p>Nos han reportado la gente de BBVAElearning que si abrimos en enlace de los cursos como &quot;abrir enlace en una ventana&quot; no se muestra correctamente.</p>','',''),(12,6,NULL,2,'2012-09-19 07:42:17','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(13,7,'marcoantonio.sanz@bbva.com',NULL,'2012-09-20 10:40:48','<p>Set Priority:Alta</p><p>Description:</p><p>Se deber&aacute; poner en la esquina superior derecha la imagen que se adjunta &nbsp;y que se enlace directamente con la p&aacute;gina.</p>','ir_a_bbva_es_v1-modificado.png',''),(14,7,NULL,2,'2012-09-20 10:41:28','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(15,7,NULL,2,'2012-09-20 10:41:33','<p>Set Priority:Alta,Status: In process</p><p>Description:</p><p></p>','',''),(16,7,'marcoantonio.sanz@bbva.com',NULL,'2012-09-20 14:53:18','<p>Set Priority:Alta,Status: In process</p><p>Description:</p><p></p>','Selección_037.png',''),(17,8,'josemanuel.delachica.contractor@bbva.com',NULL,'2012-09-21 07:22:44','<p>Set Priority:Normal</p><p>Description:</p><p><li><font color=\"#000000\">Necesitamos crear un &quot;tipo de contenido&quot; especial que  sirva para albergar un IFRAME. Este microsite tendr&aacute; una anchura m&aacute;xima de 695 px para  que quepa perfectamente en el espacio que hay disponible en la web sin tener que quitar la  columna de la derecha. Habr&iacute;a que crear un tipo de contenido/plantilla  que sea exactamente igual que cumpla las siguientes condiciones:</font></li> <ul><li><font color=\"#000000\">Pueda salir en el carrusel (con texto, imagen y extracto)</font></li><li><font color=\"#000000\">Cuando  se acceda a este contenido, no muestre t&iacute;tulo (esto incluso se puede  decidir desde el backoffice), ni imagen, ni enlaces a contenidos  relacionados, ni comentarios, ni autor, ni categor&iacute;a.... <strong>s&oacute;lo debe mostrar el cuerpo del contenido</strong>, que podr&aacute; ser editado desde el backoffice como en cualquier otro caso.&nbsp;</font></li></ul><div><font color=\"#000000\">Es decir, el objetivo es que si metemos en el &quot;Cuerpo&quot; del contenido un IFRAME, aparezca s&oacute;lo el contenido del IFRAME a la izquierda y la columna habitual a la derecha.&nbsp;</font></div><div><font color=\"#000000\">&nbsp;</font></div><div><font color=\"#000000\">PROPUESTA DE SOLUCI&Oacute;N</font></div><font color=\"#000000\">En relaci&oacute;n esto, se puede crear un nuevo tipo de contenido entrando en:<br /><br />Estructura &gt; Tipos de contenido &gt; A&ntilde;adir tipo de contenido<br /><br />Habr&iacute;a que crear un tipo de contenido &quot;Art&iacute;culo sin imagen&quot; (o nombre similar) y asignarle una versi&oacute;n de la plantilla modificada. <br /></font><div><font color=\"#000000\">Luego, agregarle los campos correspondientes, que ser&aacute;n muchos de los  que aparecen en el tipo de contenido &quot;Art&iacute;culo&quot; que ya existe, y marcar  cuales son visibles y cuales no.&nbsp;</font></div><div><font color=\"#000000\">&nbsp;</font></div><div><font color=\"#000000\">As&iacute; cuando creemos un nuevo contenido, podremos decir que es de este tipo y bastar&aacute; con editarlo e incluir el c&oacute;digo del IFRAME en el cuerpo.</font></div><div><font color=\"#000000\">&nbsp;</font></div><div><font color=\"#000000\">Muchas gracias y un saludo. &nbsp;</font></div><div>&nbsp;</div></p>','',''),(18,7,NULL,0,'2012-09-24 14:22:02','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(19,6,NULL,0,'2012-09-24 14:22:48','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(20,5,NULL,0,'2012-09-24 14:23:26','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(21,1,NULL,0,'2012-09-24 14:23:50','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(22,2,NULL,0,'2012-09-24 14:24:18','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(23,3,NULL,0,'2012-09-24 14:24:57','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(24,8,NULL,2,'2012-09-24 14:28:30','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(25,9,'marcoantonio.sanz@bbva.com',NULL,'2012-09-24 17:31:13','<p>Set Priority:Muy Alta</p><p>Description:</p><p><p>Si accedemos a los cursos de formaci&oacute;n despu&eacute;s de registrarnos directamente, la contrase&ntilde;a del usuario que se est&aacute; pasando a BBVAEleraning es la cifrada y &nbsp;no la contrase&ntilde;a en claro. Interceptar tambi&eacute;n dicha contrase&ntilde;a.</p><p>&nbsp;Probar tambi&eacute;n con los cambios de contrase&ntilde;a.&nbsp;</p></p>','',''),(26,9,NULL,2,'2012-09-24 17:31:53','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(27,10,'josemanuel.delachica.contractor@bbva.com',NULL,'2012-09-25 15:10:04','<p>Set Priority:Normal</p><p>Description:</p><p><p>Buenas tardes,</p><p>el objetivo de esta incidencia es modificar la estructura del men&uacute; Utilidades de la navegaci&oacute;n de BBVA Con tu Empresa. Consta de 2 pasos:</p><p>1) Crear una opci&oacute;n de navegaci&oacute;n. Esta nueva opci&oacute;n colgar&aacute; de &quot;Utilidades&quot; y preferiblemente aparecer&aacute; en &uacute;ltima posici&oacute;n, justo debajo de BBVA Research.La opci&oacute;n, con el texto &quot;Formaci&oacute;n empresarial&quot; llevar&aacute; a la url http://www.bbvacontuempresa.es/cursos-de-formaci%C3%B3n-empresarial</p><p>2) Deshabilitar la opci&oacute;n de men&uacute; &quot;Comercio exterior&quot; que cuelga de Utilidades. Es importante que no se borre sino que se deshabilite.&nbsp;</p><p>Muchas gracias y un saludo. &nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></p>','',''),(28,10,'josemanuel.delachica.contractor@bbva.com',NULL,'2012-09-25 15:25:24','<p>Set Priority:Normal,Status: Open</p><p>Description:</p><p><p>Adem&aacute;s de los 2 puntos especificados en la descripci&oacute;n anterior, se a&ntilde;ade un tercer punto:</p><p>La opci&oacute;n &quot;Biblioteca&quot; que cuelga de &quot;Utilidades&quot; debe temporalmente apuntar a&nbsp;http://www.bbvacontuempresa.es/afondo. La p&aacute;gina &quot;biblioteca&quot; no desaparece, pero durante un tiempo va a ser reemplazada por los contenidos de &quot;A fondo&quot;.</p><p>Muchas gracias y un saludo.&nbsp;</p></p>','',''),(29,8,'josemanuel.delachica.contractor@bbva.com',NULL,'2012-09-26 10:39:48','<p>Set Priority:Normal,Status: Suspended</p><p>Description:</p><p></p>','',''),(30,11,'josemanuel.delachica.contractor@bbva.com',NULL,'2012-10-01 10:39:00','<p>Set Priority:Normal</p><p>Description:</p><p><p>Habr&iacute;a que quitar el indicador de &quot;BETA&quot; situado en la parte superior derecha de la cabecera de la web de BBVA Con tu empresa, ya que estamos en producci&oacute;n y hemos salido de la etapa de Beta p&uacute;blica.&nbsp;</p><p>Muchas gracias y un saludo.&nbsp;</p></p>','',''),(31,11,NULL,2,'2012-10-01 11:43:40','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(32,10,NULL,2,'2012-10-01 11:44:29','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(33,10,NULL,0,'2012-10-01 15:54:53','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(34,11,NULL,0,'2012-10-03 15:04:36','Your report has been closed because the report is [Realizado y verificado].',NULL,