n closed because the report is [Realizado y verificado].',NULL,NULL),(61,12,NULL,0,'2012-10-17 09:56:42','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(62,24,'marcoantonio.sanz@bbva.com',NULL,'2012-10-18 14:44:02','<p>Set Priority:Alta</p><p>Description:</p><p>Cuando el sistema le obligue a un usuairo a estar identificado, una vez que el usuario introduce el usuario y contrase&ntilde;a deber&aacute; devolver a la pantalla donde se encontraba el usuario.</p>','',''),(63,25,'marcoantonio.sanz@bbva.com',NULL,'2012-10-18 15:00:06','<p>Set Priority:Alta</p><p>Description:</p><p><p>Generar un informe de actividad del usuario con los siguientes campos:</p><div><ul style=\"color: #222222; font-size: 13px; font-family: arial,sans-serif\"><div style=\"color: #500050\"><li style=\"margin-left: 15px; color: #222222\"> Id de usuario (real, ficticio o autogenerado)</li></div><div style=\"color: #500050\"><li style=\"margin-left: 15px; color: #222222\">Ciudad de la empresa</li><li style=\"margin-left: 15px; color: #222222\"> Provincia de la empresa</li><li style=\"margin-left: 15px; color: #222222\">C&oacute;digo postal de la empresa</li><li style=\"margin-left: 15px; color: #222222\">Sector de actividad de la empresa</li><li style=\"margin-left: 15px; color: #222222\">  Tama&ntilde;o de la empresa</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero empleados registrados de la empresa</li><li style=\"margin-left: 15px; color: #222222\">Fecha de registro</li></div><div style=\"color: #500050\">  <li style=\"margin-left: 15px; color: #222222\">Fecha de &uacute;ltimo acceso</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de preguntas por categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">  N&uacute;mero de preguntas totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de respuestas por categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de respuestas totales</li><li style=\"margin-left: 15px; color: #222222\">  N&uacute;mero de votos por preguntas en cada categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos&nbsp;por preguntas&nbsp;totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos por respuestas en cada categor&iacute;a (8 columnas)</li>  <li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos&nbsp;por respuestas totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de comentarios dejados (?)</li><li style=\"margin-left: 15px; color: #222222\">  Posici&oacute;n en el ranking de m&aacute;s votados (?)</li><li style=\"margin-left: 15px; color: #222222\">Karma</li><li style=\"margin-left: 15px; color: #222222\">Insignias y niveles obtenidos (del 0 al 4) (8 columnas)</li></div><li style=\"margin-left: 15px\"> <font color=\"#ff6600\">N&uacute;mero de visitas del usuario (?)</font></li><li style=\"margin-left: 15px\"><font color=\"#ff6600\">Fecha de registro de la empresa</font></li></ul></div><p>&nbsp;Este informe deber&aacute;&nbsp;&nbsp;&nbsp;&nbsp; ejecutarse&nbsp; con la tarea de generaci&oacute;n del karma pero deber&aacute; existir un par&aacute;metro&nbsp;&nbsp; configurable&nbsp;&nbsp; que indique si se debe o no generar dicho informe.</p><p>&nbsp;Adem&aacute;s, &nbsp; deber&aacute; existir otro par&aacute;metro que indique el n&uacute;mero de d&iacute;as que debe pasar para eliminar la informaci&oacute;n existente dentro de la tabla que se genere.&nbsp;</p><p>&nbsp;Este informe se deber&aacute; generar en formato csv y enviar por email a los administradores de LEC. Adem&aacute;s del csv, dentro del mensaje, se deber&aacute; enviar los mismo par&aacute;metros listados anteriormente pero con las medias de los usuarios. </p><p>&nbsp;</p></p>','',''),(64,26,'marcoantonio.sanz@bbva.com',NULL,'2012-10-18 15:01:31','<p>Set Priority:Alta</p><p>Description:</p><p>Se deber&aacute; hacer configurable para se pueda cambiar el nombre en un &uacute;nico sitio.</p>','',''),(65,26,NULL,2,'2012-10-18 15:02:14','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(66,25,NULL,2,'2012-10-18 15:02:34','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(67,24,NULL,2,'2012-10-18 15:02:56','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(68,27,'marcoantonio.sanz@bbva.com',NULL,'2012-10-23 18:10:29','<p>Set Priority:Muy Alta</p><p>Description:</p><p><p>Actualmente, cuando queremos compartir un contenido y pulsamos sobre el bot&oacute;n de twitter aparece la siguiente informaci&oacute;n:</p><p>Carrera solidaria organizada por BBVA | BBVA con tu empresa http://lecpre.gobernalianet.org/actualidad/finanzas/carrera-solidaria-organizada-por-bbva</p><p>&nbsp;Esta informaci&oacute;n est&aacute; compuesta por: t&iacute;tulo de la p&aacute;gina + url</p><p>&nbsp;&nbsp;La petici&oacute;n es que aparezca lo siguiente:</p><p>Carrera solidaria organizada por BBVA http://lecpre.gobernalianet.org/actualidad/finanzas/carrera-solidaria-organizada-por-bbva v&iacute;a @BBVA&nbsp;</p><p>&nbsp;donde:&nbsp;&nbsp;Carrera solidaria organizada por BBVA es el t&iacute;tulo del contenido ([current-page:title-plain])</p><p>&nbsp;@BBVA: Es usuario de twitter configurado dentro de la aplicaci&oacute;n ([socialmedia:sm-twitter_username])</p><p>&nbsp;Un saludo.&nbsp;</p></p>','',''),(69,27,NULL,2,'2012-10-23 18:11:05','<p>Set Status: In Process</p><p>Description:</p><p>Your report is being processed.</p>',NULL,NULL),(70,27,NULL,0,'2012-11-02 11:09:44','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(71,24,NULL,0,'2012-11-02 11:11:50','Your report has been closed because the report is [Realizado y verificado].',NULL,NULL),(72,13,NULL,0,'2012-11-16 12:30:38','Your report has been closed bec