esta incidencia es modificar la estructura del men&uacute; Utilidades de la navegaci&oacute;n de BBVA Con tu Empresa. Consta de 2 pasos:</p><p>1) Crear una opci&oacute;n de navegaci&oacute;n. Esta nueva opci&oacute;n colgar&aacute; de &quot;Utilidades&quot; y preferiblemente aparecer&aacute; en &uacute;ltima posici&oacute;n, justo debajo de BBVA Research.La opci&oacute;n, con el texto &quot;Formaci&oacute;n empresarial&quot; llevar&aacute; a la url http://www.bbvacontuempresa.es/cursos-de-formaci%C3%B3n-empresarial</p><p>2) Deshabilitar la opci&oacute;n de men&uacute; &quot;Comercio exterior&quot; que cuelga de Utilidades. Es importante que no se borre sino que se deshabilite.&nbsp;</p><p>&nbsp;</p></p>','',''),(25,11,2,'2012-10-01 15:54:53','<p>Set Priority:Normal, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(26,10,2,'2012-10-03 15:04:36','<p>Set Priority:Normal, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(27,9,2,'2012-10-03 15:04:55','<p>Set Priority:Muy Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(28,7,2,'2012-10-03 15:05:21','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:</p><p>Description:</p><p></p>','',''),(29,12,2,'2012-10-03 15:29:15','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:En proceso, Assign To:dmiranda</p><p>Description:</p><p></p>','',''),(30,13,2,'2012-10-03 15:29:43','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:En proceso, Assign To:dmiranda</p><p>Description:</p><p></p>','',''),(31,14,2,'2012-10-03 15:57:51','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:En proceso, Assign To:dmiranda</p><p>Description:</p><p>El mensaje debe decir &quot;Enhorabuena, tienes la oportunidad de ser el  primero en realizar una pregunta al experto &iexcl;Aprovecha y deja tu  consulta!&quot; </p>','',''),(32,15,2,'2012-10-03 15:58:10','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p>El bloque estar&aacute; separado y destacado en una caja, por encima del  buscador y bien diferenciado. Incluir&aacute; una llamada a la acci&oacute;n potente  mediante un bot&oacute;n grande y resaltado de &quot;Deja tu pregunta&quot;</p>','',''),(33,16,2,'2012-10-03 15:58:37','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:En proceso, Assign To:dmiranda</p><p>Description:</p><p>El nombre ser&aacute; un link a su perfil, como en el caso de los logos. </p>','',''),(34,17,2,'2012-10-03 15:59:11','<p>Import from Customer Feedback</p><p>Set Priority:Muy Alta, \n	Status:En proceso, Assign To:dmiranda</p><p>Description:</p><p>Este lightbox se cerrar&aacute; pulsando el icono X o pulsando Escape y no  contendr&aacute; botones de cerrar. Tampoco tendr&aacute; barra de t&iacute;tulo. El &uacute;nico  contenido del lightbox ser&aacute; un IFRAME o mecanismo similar que aloje un  sitio web externo (a&uacute;n por determinar). Este lightbox&nbsp; s&oacute;lo se cerrar&aacute;  bajo petici&oacute;n del usuario.</p>','',''),(35,18,2,'2012-10-05 07:37:05','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:En proceso, Assign To:jelingan</p><p>Description:</p><p></p>','Selección_039.png',''),(36,18,2,'2012-10-05 09:06:27','<p>Set Priority:Alta, Status:En proceso(active), Assign To:jelingan</p><p>Description:</p><p></p>','Selección_041.png',''),(37,18,2,'2012-10-05 12:35:47','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(38,19,2,'2012-10-08 10:17:47','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Realizado y verificado, Assign To:dmiranda</p><p>Description:</p><p><p>Sustituir la imagen del banner a BBVA.es, situado en la columna de la  derecha del sitio web, por la imagen que se adjunta. Se trata de una  imagen muy similar pero sin el dibujo de &quot;la mano azul y blanca&quot;.</p><p>Adem&aacute;s de sustituir una imagen por otra, hay que modificar la URL a la que apunta.&nbsp;</p><p>En lugar de llevar a&nbsp;<a style=\"font-family: arial,sans-serif; line-height: normal; color: #1155cc\" href=\"https://www.bbva.es/TLBS/tlbs/esp/segmento/particulares/index.jsp\" target=\"_blank\">https://www.bbva.es/TLBS/tlbs/esp/segmento/particulares/index.jsp</a>, debe llevar a la URL&nbsp;<a style=\"font-family: arial,sans-serif; line-height: normal; color: #1155cc\" href=\"https://www.bbva.es/TLBS/tlbs/esp/segmento/empresas/index.jsp\" target=\"_blank\">https://www.bbva.es/TLBS/tlbs/esp/segmento/empresas/index.jsp</a><span style=\"color: #500050; font-family: arial,sans-serif; line-height: normal\">&nbsp;</span>&nbsp;, es decir, al &aacute;rea de empresas en lugar de al &aacute;rea de particulares.&nbsp;</p><p>Un saludo y muchas gracias.&nbsp; </p></p>','',''),(39,20,2,'2012-10-08 10:29:39','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:</p><p>Description:</p><p></p>','',''),(40,20,2,'2012-10-08 10:30:23','<p>Set Priority:Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:</p><p>Description:</p><p>Se ha probado tanto en preproducci&oacute;n como en producci&oacute;n.</p>','',''),(41,17,4,'2012-10-10 07:33:16','<p>Set Priority:Muy Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:dmiranda</p><p>Description:</p><p><div><br /></div><div>Por definir el ancho y alto del contenido.</div></p>','',''),(42,16,4,'2012-10-10 11:15:46','<p>Set Priority:Alta, Status:En proceso(active), Assign To:dmiranda<br>updated <font color=red>summary</font><br>old: \"Incluir en la newsletter el nombre de las empresas recomendadas y no sólo su logo. Corregir los CSS para que no aparezcan &quot;puntos&quot; en la newsletter enviada\"<br>new:<font color=blue>\"Incluir en la newsletter el nombre de las empresas recomendadas y no sólo su logo. Corregir los CSS para que no aparezcan &quot;puntos&quot; en la newsletter enviada. Mensaje en profile si no tiene imagen\"</font></p><p>Description:</p><p></p>','',''),(43,14,4,'2012-10-10 15:32:31','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:dmiranda</p><p>Description:</p><p></p>','',''),(44,13,4,'2012-10-11 11:25:53','<p>Set Priority:Alta, Status:<font color=red>Realizado. Pendiente de validación</font>, Assign To:dmiranda</p><p>Description:</p><p><div><br /></div><div>ficheros a actualizar:</div><div>&nbsp; - &nbsp; /sites/all/themes/lec/templates/user-profile.tpl.php</div>&nbsp; - &nbsp; /sites/all/themes/lec/templates/template.php</p>','',''),(45,17,2,'2012-10-16 08:44:58','<p>Set Priority:Muy Alta, Status:Realizado. Pendiente de validación(active), Assign To:dmiranda</p><p>Description:</p><p><p>Esta funcionalidad se ha despriorizado (aunque ya la vamos a terminar). Adem&aacute;s de un landingpage, estar&iacute;a bien que puedieramos configurar varias p&aacute;ginas seg&uacute;n el par&aacute;metro.</p><p>Es decir:</p><p>landingpage=launch</p><p>y que launch sea un par&aacute;metro configurable del estilo : launch = www.marca.com</p><p>&nbsp;</p></p>','',''),(46,15,2,'2012-10-16 08:46:33','<p>Set Priority:Alta, Status:<font color=red>En proceso</font>, Assign To:<font color=red>dmiranda</font></p><p>Description:</p><p></p>','',''),(47,17,2,'2012-10-17 09:56:17','<p>Set Priority:Muy Alta, Status:Realizado. Pendiente de validación(active), Assign To:dmiranda</p><p>Description:</p><p>Oks.&nbsp;</p>','',''),(48,17,2,'2012-10-17 09:56:42','<p>Set Priority:Muy Alta, Status:<font color=red>Realizado y verificado</font>, Assign To:<font color=red></font></p><p>Description:</p><p></p>','',''),(49,16,2,'2012-10-17 10:14:33','<p>Set Priority:Alta, Status:En proceso(active), Assign To:dmiranda</p><p>Description:</p><p><p>Aparece un trozo de c&oacute;digo en la p&aacute;gina. Adem&aacute;s se muestran 4 empresas en la misma l&iacute;nea y la quinta en otra y deber&iacute;an aparecer todas en la misma.</p><p>&nbsp;Adjunto imagen.</p></p>','Selección_043.png',''),(50,15,2,'2012-10-17 10:50:15','<p>Set Priority:Alta, Status:En proceso(active), Assign To:dmiranda</p><p>Description:</p><p><div id=\":5a\" dir=\"ltr\" class=\"kl\">tendr&iacute;amos que poner siempre la parte de &quot;deja tu pregunta&quot;</div><div id=\":52\" dir=\"ltr\" class=\"kl\">y no s&oacute;lo cuando no hay resultados</div><div id=\":5y\" dir=\"ltr\" class=\"kl\">adem&aacute;s, hay que tener cuidado con poner &quot;all displays&quot; cuando no hay resultados</div><div id=\":5x\" dir=\"ltr\" class=\"kl\">deber&iacute;amos poner s&oacute;lo para esta p&aacute;gina</div><div id=\":54\" dir=\"ltr\" class=\"kl\">y a&ntilde;adir como encabezado el formulario</div><div id=\":53\" dir=\"ltr\" class=\"kl\">de dejar tu pregunta. Te pongo un ejemplo gr&aacute;fico sin formatear.</div></p>','Selección_044.png',''),(51,12,2,'2012-10-17 14:30:17','<p>Set Priority:Alta, Status:En proceso(active), Assign To:dmiranda</p><p>Description:</p><p>En los perfiles de usuario, en el enlace &quot;Ver todas&quot; que est&aacute; en el bloque &quot;Preguntas recientes&quot;, acceder a la misma p&aacute;gina que se accede actualmente pero mostrando &uacute;nicamente aquellas preguntas que ha lanzado el usuario</p>','',''),(52,12,2,'2012-10-17 14:32:12','<p>Set Priority:Alta, Status:En proceso(active), Assign To:dmiranda</p><p>Description:</p><p>No me aparecen las preguntas y me siguen saliendo todas.</p>','',''),(53,21,2,'2012-10-18 15:02:14','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p>Se deber&aacute; hacer configurable para se pueda cambiar el nombre en un &uacute;nico sitio.</p>','',''),(54,22,2,'2012-10-18 15:02:34','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p><p>Generar un informe de actividad del usuario con los siguientes campos:</p><div><ul style=\"color: #222222; font-size: 13px; font-family: arial,sans-serif\"><div style=\"color: #500050\"><li style=\"margin-left: 15px; color: #222222\"> Id de usuario (real, ficticio o autogenerado)</li></div><div style=\"color: #500050\"><li style=\"margin-left: 15px; color: #222222\">Ciudad de la empresa</li><li style=\"margin-left: 15px; color: #222222\"> Provincia de la empresa</li><li style=\"margin-left: 15px; color: #222222\">C&oacute;digo postal de la empresa</li><li style=\"margin-left: 15px; color: #222222\">Sector de actividad de la empresa</li><li style=\"margin-left: 15px; color: #222222\">  Tama&ntilde;o de la empresa</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero empleados registrados de la empresa</li><li style=\"margin-left: 15px; color: #222222\">Fecha de registro</li></div><div style=\"color: #500050\">  <li style=\"margin-left: 15px; color: #222222\">Fecha de &uacute;ltimo acceso</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de preguntas por categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">  N&uacute;mero de preguntas totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de respuestas por categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de respuestas totales</li><li style=\"margin-left: 15px; color: #222222\">  N&uacute;mero de votos por preguntas en cada categor&iacute;a (8 columnas)</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos&nbsp;por preguntas&nbsp;totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos por respuestas en cada categor&iacute;a (8 columnas)</li>  <li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de votos&nbsp;por respuestas totales</li><li style=\"margin-left: 15px; color: #222222\">N&uacute;mero de comentarios dejados (?)</li><li style=\"margin-left: 15px; color: #222222\">  Posici&oacute;n en el ranking de m&aacute;s votados (?)</li><li style=\"margin-left: 15px; color: #222222\">Karma</li><li style=\"margin-left: 15px; color: #222222\">Insignias y niveles obtenidos (del 0 al 4) (8 columnas)</li></div><li style=\"margin-left: 15px\"> <font color=\"#ff6600\">N&uacute;mero de visitas del usuario (?)</font></li><li style=\"margin-left: 15px\"><font color=\"#ff6600\">Fecha de registro de la empresa</font></li></ul></div><p>&nbsp;Este  informe deber&aacute;&nbsp;&nbsp;&nbsp;&nbsp; ejecutarse&nbsp; con la tarea de generaci&oacute;n del karma  pero deber&aacute; existir un par&aacute;metro&nbsp;&nbsp; configurable&nbsp;&nbsp; que indique si se debe  o no generar dicho informe.</p><p>&nbsp;Adem&aacute;s, &nbsp; deber&aacute; existir otro  par&aacute;metro que indique el n&uacute;mero de d&iacute;as que debe pasar para eliminar la  informaci&oacute;n existente dentro de la tabla que se genere.&nbsp;</p><p>&nbsp;Este  informe se deber&aacute; generar en formato csv y enviar por email a los  administradores de LEC. Adem&aacute;s del csv, dentro del mensaje, se deber&aacute;  enviar los mismo par&aacute;metros listados anteriormente pero con las medias  de los usuarios. </p></p>','',''),(55,23,2,'2012-10-18 15:02:56','<p>Import from Customer Feedback</p><p>Set Priority:Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p>Cuando el sistema le obligue a un usuairo a estar identificado, una vez  que el usuario introduce el usuario y contrase&ntilde;a deber&aacute; devolver a la  pantalla donde se encontraba el usuario.</p>','',''),(56,24,2,'2012-10-23 18:11:05','<p>Import from Customer Feedback</p><p>Set Priority:Muy Alta, \n	Status:Aplazado, Assign To:dmiranda</p><p>Description:</p><p></p>','',''),(57,12,4,'2012-10-24 09:44:11','<p>Set Priority:Alta, Status:<font color=red